import React from 'react';
import Navigation from 'components/Navigation/Navigation';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header f2">
        <h1>pressure sensitive</h1>
      </header>
      <div className="Navigation">
        <Navigation />
      </div>
    </div>
  );
}

export default App;
